import image from "https://i.imgur.com/l2Xfgpl.jpg";
import React from 'react';

function Video() {

    let videoApi = axios.get(
        "https://project-2-api.herokuapp.com/stream?api_key=SeanTang"
      );

    videoApi.then(run => {
        console.log(run.data);
      });
      videoApi.catch(error => {
        console.log("error!!");
      });
      

    return(
        <div className="video__container">
            <video width="320" height="240" className="video" poster={image} controls>
                <source src={run.data} type="link"/>
            </video>
        </div>
    );
}

export default Video;
